import { Component } from "react";
import getQuestions from "./questions";

class History extends Component {
    constructor() {
        super();
        questions = getQuestions()
        this.state = {
            history: []
        }
    }

    addEvent(question_id, answer_id) {
        this.state.history = [...this.state.history, {id: question_id, answer_id: answer_id}]
        console.log(this.state.history)
    }

    // storeHistory() -- store to SQL database
}

export default History
